import React from "react";

const UserData = props => {
  const fetchedData = props;
  console.log("user data comp ", fetchedData);
  // const { id, name, username, email } = fetchedData;
  // console.log("id ", id, name);
  return (
    <div>
      <input type="text" placeholder="Name" defaultValue={props.name} />
      <input type="text" placeholder="Email" defaultValue={props.email} />
      <input
        type="text"
        placeholder="Company"
        defaultValue={props.company.name}
      />
    </div>
  );
};

export default UserData;
